import React, { Component } from "react";

class Selector extends React.Component {
  render() {
    const { id, lab, opt1, opt2 } = this.props.selector;
    console.log(lab + id);
    return (
      <div className="m-2">
        <span className="me-2">{lab} </span>
        <div className="btn-group">
          <input
            type="radio"
            name={lab}
            className="btn-check"
            id={opt1}
            autoComplete="off"
          />
          <label className="btn btn-outline-primary" htmlFor={opt1}>
            {opt1}
          </label>
          <input
            type="radi"
            name={lab}
            className="btn-check"
            id={opt2}
            autoComplete="off"
          />
          <label className="btn btn-outline-primary">{opt2}</label>
        </div>
      </div>
    );
  }
}

export default Selector;
